    return(
        <div className="choose-us-cont">
            <img src="others.png" alt="" />
            <div className="choose-main-cont">
                <div className="choose-cont1"></div>
                <div className="choose-cont2"></div>
            </div>
        </div>
    )
}

export default ChooseUs;
